import './App.css';
import Header from './components/Header';
import HeroSection from './components/Herosection';

function App() {
  return (
    <div className="App">
      <Header />
      <HeroSection />
      <ServicesSection />
      <FeaturesSection />
      <CallToActionSection />
      <Footer />
    </div>
  );
}

export default App;
